import React from "react";
// import { Icon } from "semantic-ui-react";
import Icon from "@bit/semantic-org.semantic-ui-react.icon";
import StyleLinks from "@bit/semantic-org.semantic-ui-react.internal.style-links";

const Footer = () => (
  <footer>
    <div class="links">
      <StyleLinks />
      <Icon name="github" link size="huge"></Icon>

      <StyleLinks />
      <Icon name="linkedin square" link size="huge"></Icon>

      <StyleLinks />
      <Icon name="stack overflow" link size="huge"></Icon>
    </div>
  </footer>
);
export default Footer;
